import style from './ConhecaCursos.module.css'
function ConhecaCursos(){
    return(
        <section className={style.container}>
        <h1>Conheça nossos cursos</h1>
            <img src={SaladeaulafaculdadeImage} alt='Sala de aula' />
            <p>Explore os horizontes do conhecimento com os nossos cursos de MBA de excelência. Desenvolvidos por especialistas do setor, nossos programas oferecem uma abordagem prática e inovadora para impulsionar sua carreira. Aperfeiçoe suas habilidades, conquiste novas oportunidades e esteja à frente no mercado com a expertise adquirida em nossos cursos de MBA.<Link></Link></p>
            
        </section>
    )
}

export default ConhecaCursos
